import React from 'react';
import './App.css';
import LiveTrading from './components/LiveTrading';
import Orders from './components/Orders';
import Analytics from './components/Analytics';
import DhanStatus from './components/DhanStatus';
import FundBalance from './components/FundBalance';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>InfinityAI.Pro Dashboard</h1>
        <nav style={{ marginBottom: '2rem' }}>
          <a href="#live" style={{ marginRight: '2rem' }}>Live Trading</a>
          <a href="#orders" style={{ marginRight: '2rem' }}>Orders</a>
          <a href="#analytics">Analytics</a>
        </nav>
      </header>
      <main>
        <DhanStatus />
        <FundBalance />
        <section id="live">
          <LiveTrading />
        </section>
        <section id="orders">
          <Orders />
        </section>
        <section id="analytics">
          <Analytics />
        </section>
      </main>
    </div>
  );
}

export default App;
